INSERT INTO `diagnosis` VALUES (1,'Food Allergies ','អាលែហ្សីជាមួយចំណីអាហារ',1),(2,'Anaphylaxis ','អាលែហ្សីខ្លាំងតបនឹងចំនីអាហារ ថ្នាំ សារធាតុផ្សេងៗ',1),(3,'Allergic Conjunctivitis ','អាលែហ្សីនៅភ្នាសសើម',1),(4,'Allergic Contact Dermatitis','អាលែហ្សីនៅស្បែកដោយប៉ះធាតុលោហផ្សេងៗ',1),(5,'Drug eruption ','ការប៉ះពាល់ខូចខាតលើស្បែកដោយសារថ្នាំ',1),(6,'Oedème de quincke ','ការឡើងហើមនៅបរិវេនក្បាលនិងក',1),(7,'Réaction inflammatoire ','ប្រតិកម្មប្រឆាំងនិងមេរោគ',1),(8,'Transfusion Reactions ','ប្រតិកម្មដោយសារការបញ្ចូលសារធាតុរាវក្នុងខ្លួន',1),(9,'Allergic Rhinitis ','អាលែហ្សីច្រមុះដោយសារធាតុបង្កអាលែហ្សែន',1),(10,'Rhinitis Medicamentosa','អាលែហ្សីច្រមុះដោយសារថ្នាំ',1),(11,'Allergic Fungal Sinusitis','អាលែហ្សីស៊ីនុសច្រមុះដោយសារផ្សិត',1),(12,'Contact Urticaria Syndrome ','បណ្ដុំរោគសញ្ញាកន្ទាលត្រអាកដោយប៉ះពាល់',1),(13,'Urticaria ','កន្ទាលត្រអាក',1),(14,'Acute Urticaria ','កន្ទាលត្រអាកស្រួចស្រាល',1),(15,'Cholinergic Urticaria ','កន្ទាលត្រអាកកូលីននែជីក',1),(16,'Chronic Urticaria ','កន្ទាលត្រអាករាំរ៉ៃ',1),(17,'Solar Urticaria ','ឡើងកន្ទាលត្រអាកដោយសារពន្លឺ',1),(18,'Allergic and Environmental Asthma ','អាលែហ្សីនិងកើតហឺតដោយសារបរិយាកាសជុំវិញ',1),(19,'Angioedema ','ហើមនៅតាមសរសៃឈាមតូចៗ',1),(20,'Ashma in Pregnancy','ជំងឺហឺតលើស្រ្តីមានផ្ទៃពោះ',1),(21,'Berloque Dermatitis ','រលាកស្បែកដោយសារទឹកអប់',1),(22,'Delayed hypersensitivity Reaction','ប្រតិកម្មឆ្លើយតបយឺត',1),(23,'Drug-Induced Photosensitivity ','ងាយរលាកដោយពន្លឺបណ្ដាលមកពីថ្នាំ',1),(24,'Drug-Induced Pigmentation ','ស្បែកឡើងពណ៌ខ្លាំងបណ្ដាលមកពីថ្នាំ',1),(25,'Dyshidrotic Eczema ','ប្រភេទត្រអកពងទឹកតូចៗ',1),(26,'Fixed Drug Eruption ','ចេញក្រហមជាំលើស្បែកដោយសារប្រតិកម្មនឹងថ្នាំ',1),(27,'Genetics of asthma ','កើតហឺតដោយសារហ្សែនពីកំណើត',1),(28,'Hypogammaglobulinemia ','ថយចុះពពួកហ្គាម៉ាក្លូប៊ុយលីនក្នុងឈាម',1),(29,'Immediate Hypersensitivity Reaction ','ប្រតិកម្មឆ្លើយតបភ្លាមៗ',1),(30,'Immunoglobulin A Deficiency ','កង្វះអ៊ីមុយណូក្លូប៊ុយលីនA',1),(31,'Immunoglobulin D Deficiency ','កង្វះអ៊ីមុយណូក្លូប៊ុយលីនD',1),(32,'Immunoglobulin G Deficiency ','កង្វះអ៊ីមុយណូក្លូប៊ុយលីនG',1),(33,'Immunoglobulin M Deficiency ','កង្វះអ៊ីមុយណូក្លូប៊ុយលីនM',1),(34,'Irritant Contact Dermatitis ','ប្រតិកម្មស្បែកដោយប៉ះ',1),(35,'latex Allery ','អាលែហ្សីជាមួយសារធាតុឡាតិច',1),(36,'Lichen Simplex Chronicus ','អាលែហ្សីជាមួយសារធាតុឡាតិច',1),(37,'Type I Polyglandular Autoimmune Syndrome ','ជំងឺពហុក្រពេញបញ្ចេញក្នុងប្រឆាំងខ្លូនឯងប្រភេទ១',1),(38,'Type II Polyglandular Autoimmune Syndrome ','ជំងឺពហុក្រពេញបញ្ចេញក្នុងប្រឆាំងខ្លូនឯងប្រភេទ២',1),(39,'Type III Polyglandular Autoimmune Syndrome ','ជំងឺពហុក្រពេញបញ្ចេញក្នុងប្រឆាំងខ្លូនឯងប្រភេទ៣',1),(40,'Vesicular Palmoplantar Eczema ','ត្រអកពងទឹកថ្លានៅបាតដៃ',1),(41,'Skin Allergy','ប្រតិកម្មលើស្បែក',1),(42,'Slérodermie','ស្បែកឡើងរឹង',1),(43,'Seleroderma','ស្បែកឡើងរឹង',1),(44,'Hypertension','លើសសម្ពាធឈាម',2),(45,'Angine de poitrine ','ឈឺទ្រូង',2),(46,'Arythmies','ភាពមិនប្រក្រតីនៃចង្វាក់បេះដូង',2),(47,'Choc cardiogénique','ស្ហុកបណ្ដាលមកពីបេះដូង',2),(48,'Endocardite','រលាកស្រោមបេះដូងផ្នែកខាងក្នុង',2),(49,'Myocardite','រលាកសាច់បេះដូង',2),(50,'Pericarditis','រលាកស្រោមបេះដូងផ្នែកខាងក្រៅ',2),(51,'Accident vasculaire cérébral ','គ្រោះថ្នាក់ដាច់សសៃឈាមខួរក្បាល',2),(52,'Cardiaque hypertrophié','បេះដូងរីក',2),(53,'Choc hypovolémique','ស្ហុកដោយសារបាត់បង់ឈាមច្រើន',2),(54,'Endoperimyocarditis','រលាកខាងក្នុងនិងជុំវិញនៃសាច់ដុំបេះដូង',2),(55,'Infarctus du myocarde','ស្លោកសាច់ដុំបេះដូង',2),(56,'Insuffisance Cardiaque ','ខ្សោយបេះដូង',2),(57,'heart ischemic','ឈាមទៅចិញ្ចឹមសាច់បេះដូងមិនគ្រប់គ្រាន់',2),(58,'Maladie valvulaire cardiaque','ជំងឺប្រើសបេះដូង',2),(59,'Thrombose veineux','ដុំកំនកឈាមនៅសរសៃវ៉ែន',2),(60,'Acute aorta dissection','រហែកសរសៃឈាមអាអ័កស្រួចស្រាវ',2),(61,'Acute Articulaire Rhumatisme','ជំងឺរលាកសន្លាក់ស្រួចស្រាវ',2),(62,'Acute Obstruction arterial of membre','ស្ទះសរសៃឈាមនៅអវៈយវៈស្រួចស្រាវ',2),(63,'Adams-Stokes Syndrome','បណ្ដុំនៃរោគសញ្ញានៃជំងឺAdams',2),(64,'Aneurysme and ','សរសៃឈាមប៉ោង',2),(65,'Angina Pectoris','ឈឺដូចគេចាក់នៅដើមទ្រូង',2),(66,'Aorta Dissection','រហែកសរសៃឈាមអាអ័ក',2),(67,'Aortic Valve Insuffisancie','ជំងឺបិទប្រើសអាអ័កមិនជិត',2),(68,'Arrhythmia','ភាពមិនប្រក្រតីនៃចង្វាក់បេះដូង',2),(69,'Arterial hypotesion','សម្ពាធឈាមចុះទាប',2),(70,'Arterial hypotesion and Orthostatic dysregulation','សម្ពាធឈាមអាកទែចុះទាបនិងសម្ពាធឈាមអាកទែចុះទាបពេលងើបឈរ',2),(71,'Arteriopathy Oblitration of inferior boder','ជំងឺស្ទះសរសៃឈាមផ្នែកខាងក្រោម',2),(72,'Arteriosclerosis','សរសៃឈាមរឹងក្រិន',2),(73,'Arteritis of inferior boder','រលាកសរសៃឈាមផ្នែកខាងក្រោម',2),(74,'Bicuspidy valvular aorta','ភាពមិនធម្មតាពីកំណើតនៃប្រើសរបស់អាអ័ក',2),(75,'Cardiac Conduction Trouble','វិបត្តិចរន្ដបេះដូង',2),(76,'Cardiac Rythme Trouble','វិបត្តិចង្វាក់បេះដូង',2),(77,'Cardiac Rythme Trouble with Bradycardia','វិបត្តិចង្វាក់បេះដូងរួមជាមួយបេះដូងដើរយឺត',2),(78,'Cardiac Rythme Trouble with Tachycardia','វិបត្តិចង្វាក់បេះដូងរួមជាមួយបេះដូងដើរលឿន',2),(79,'Cardiac Tumeur','ដុំនៅបេះដូង',2),(80,'Cardiac Valvulopathy','ជំងឺប្រើសបេះដូង',2),(81,'Cardiomyopathy','ជំងឺសាច់ដុំបេះដូង',2),(82,'Chronic total oclusion of coronaire artere','ស្ទះសរសៃឈាមកូរូណាទាំងអស់រាំរ៉ៃ',2),(83,'Congenitales Cardiopathy','ជំងឺបេះដូងពីកំណើត',2),(84,'Cardiomyopathies dilatées(CMD)','ជំងឺសាច់ដុំបេះដូងរីក',2),(85,'Heart diseases','ជំងឺបេះដូង',2),(86,'Heart failure','ខ្សោយបេះដូង',2),(87,'Heart right Valvulopathy acquises','ជំងឺថតបេះដូងខាងស្ដាំ',2),(88,'Heart-Lung Chronic','ជំងឺសួតរាំរ៉ៃបណ្ដាលពីបេះដូងមានបញ្ហា',2),(89,'Hypertension Arterial','សម្ពាធឈាមឡើងខ្ពស់',2),(90,'Hypertrophy of Cardiomyopathy(HCM)','ជំងឺសាច់ដុំបេះដូងរីក',2),(91,'CIA (Communication inter-auriculaire) ','ទំនាក់ទំនងរវាងថតបេះដូងខាងលើ',2),(92,'CIV(Communication Interventriculaire)','ទំនាក់ទំនងរវាងថតបេះដូងខាងក្រោម',2),(93,'Marfan Diseases','ជំងឺMarfan',2),(94,'Mitral Valve Insuffisancie','ជំងឺបិទប្រើសមីត្រាល់មិនជិត',2),(95,'Myocardial infarction','ស្លោកសាច់ដុំបេះដូង',2),(96,'Myocarditis','រលាកសាច់បេះដូង',2),(97,'Obliteration Arteriopathy','ជំងឺស្ទះសរសៃឈាមទាំងស្រុង',2),(98,'Epanchement péricardique','ដក់ទឹកនៅស្រោមបេះដូង',2),(99,'Permeable Foramen ovale','ភាពឆ្លងបាននៃសន្ទះខណ្ឌថតបេះដូងខាងលើ',2),(100,'Prinzmetal of Angina','ចុកទ្រូងជាទម្រង់Prinzmetal ',2),(101,'Pulmonary Arterial hypotesion','សម្ពាធឈាមនៅសរសៃឈាមសួតចុះទាប',2),(102,'Raynaud Syndrome','បណ្ដុំរោគសញ្ញាRaynaud',2),(103,'Syncope origine of cardiovascular','សន្លប់បណ្ដាលមកពីជំងឺសរសៃឈាមបេះដូង',2),(104,'Tachycardia','បេះដូងលោតញាប់',2),(105,'Tamponade','តំប៉ូណាត',2),(106,'Thromboembolic Diseases','ជំងឺស្ទះសរសៃឈាមដោយសារដុំកំនកឈាម',2),(107,'Valvular aorta retrecissement','ប្រើសសរសៃឈាមអាអ័កបើកមិនអស់',2),(108,'Valvular heart diseases','ជំងឺប្រើសបេះដូង',2),(109,'Valvular Mitral Prolapsus Syndrome','បណ្ដុំរោគសញ្ញាស្ពៀតប្រើសមីត្រាល់',2),(110,'(RM)Rétrécissement Valvulaire Mitral','ប្រើសសរសៃឈាមមីត្រាល់បើកមិនអស់',2),(111,'Valvular Pulmonaire retrecissement','ប្រើសសរសៃឈាមសួតបើកមិនអស់',2),(112,'Vascular Diseases','ជំងឺសរសៃឈាម',2),(113,'Thrombose Veineuse Profonde','ជំងឺកំនកដុំឈាមសរសៃវ៉ៃនជ្រៅ',2),(114,'Thrombose Veineuse Superficielle','ជំងឺកំនកដុំឈាមសរសៃវ៉ៃនរាក់',2),(115,'Thrombose veineuse profonde (phlébite) et embolie pulmonaire','ជំងឺកំនកដុំឈាមសរសៃវ៉ៃនជ្រៅ និងដុំកំនកឈាមស្ទះសរសៃឈាមសួត',2),(116,'Allergie ','អាលែហ្សី',2),(117,'Aneurysme and ','សរសៃឈាមប៉ោង',2),(118,'Angina Pectoris','ឈឺដូចគេចាក់នៅដើមទ្រូង',2),(119,'Prinzmetal of Angina','ចុកទ្រូងជាទម្រង់Prinzmetal ',2),(120,'Obliteration Arteriopathy','ជំងឺស្ទះសរសៃឈាមទាំងស្រុង',2),(121,'Arteriopathy Oblitration of inferior boder','ជំងឺស្ទះសរសៃឈាមផ្នែកខាងក្រោម',2),(122,'Arteriosclerosis','សរសៃឈាមរឹងក្រិន',2),(123,'Arteritis of inferior boder','រលាកសរសៃឈាមផ្នែកខាងក្រោម',2),(124,'Arrhythmia','ភាពមិនប្រក្រតីនៃចង្វាក់បេះដូង',2),(125,'Bicuspidy valvular aorta','ភាពមិនធម្មតាពីកំណើតនៃប្រើសរបស់អាអ័ក',2),(126,'Cardiomyopathy','ជំងឺសាច់ដុំបេះដូង',2),(127,'Cardiomyopathies dilatées(CMD)','ជំងឺសាច់ដុំបេះដូងរីក',2),(128,'Hypertrophy of Cardiomyopathy(HCM)','ជំងឺសាច់ដុំបេះដូងរីក',2),(129,'Cardiopathie','ជំងឺបេះដូង',2),(130,'Congenitales Cardiopathy','ជំងឺបេះដូងពីកំណើត',2),(131,'Heart-Lung Chronic','ជំងឺសួតរាំរ៉ៃបណ្ដាលពីបេះដូងមានបញ្ហា',2),(132,'CIA (Communication inter-auriculaire) ','ទំនាក់