uble vasculaire périphérique','វិបត្តិសរសៃឈាមជុំវិញខ្លូន',2),(197,'Insuffisance Mitrale (IM)','ប្រើសសរសៃឈាមមីត្រាល់បើកមិនអស់',2),(198,'Angor stable','ចុកទ្រូងនៅពេលធ្វើចលនារាងកាយខ្លាំង',2),(199,'Angor instable','ចុកទ្រូងដោយមិនធ្វើចលនាឬធ្វើតិចតួច',2),(200,'Varice membre inférieur','សរសៃឈាមវ៉ែនរីកប៉ោងនៅអវយវៈក្រោម',2),(201,'Tumeur vasculaire','ដុះដុំនៅសរសៃឈាម',2),(202,'Bradycardy sinusal','ចង្វាក់បេះដូងលោតយឺត',2),(203,'Sténose artère coronnaire','ត្បៀតសរសៃឈាមកូរ៉ូណា',2),(204,'Ulcération varique','ដំបៅសរសៃវ៉ែន',2),(205,'Varice dans le coude','សរសៃឈាមវ៉ែនរីកប៉ោងក្នុងកែងដៃ',2),(206,'Myo-Péricardite chez polyrhumatoïde','រលាកសាច់និងស្រោមបេះដូងលើអ្នកជំងឺរលាកសន្លាក់',2),(207,'Plaie vasculaire du poignet','របួសសរសៃឈាមកដៃ',2),(208,'TVP de Membre inférieure ','ស្ទះសរសៃឈាមវ៉ែនជ្រៅរបស់អវយវៈក្រោម',2),(209,'Annuloplastie mitral','វះកាត់ជួសជុលប្រើសមីត្រាល់',2),(210,'Fissure','រហែក',2),(211,'Remplacement valve aortique mécanique','ផ្លាស់ប្ដូប្រើសអាអ័ក',2),(212,'Pulmonary hypertension','ឡើងសម្ពាធឈាមនៅសួត',2),(213,'Early repolarisation syndrome','បណ្ដុំសញ្ញាឆាប់ភ្ញោជនៃចរន្ដបេះដូង',2),(214,' Insuffisance veineuse','ខ្សោយសរសៃវ៉ែន',2),(215,'Extrasystole auriculaire','ភាពមិនប្រក្រតីនៃការកន្រ្ដាក់ថតបេះដូងខាងលើ',2),(216,'HTA','ជំងឺលើសសម្ពាធឈាម',2),(217,'Syndrome coronarien aiguë','បណ្ដុំរោគសញ្ញាសរសៃឈាមកូរូណាស្រួចស្រាវ',2),(218,'Syndrome Coiffe rotatent','បណ្ដុំរោគសញ្ញារលាកថង់ទឹកសន្លាក់និងសរសៃពួរ',2),(219,'Pre- Hypertension','បំរុងលើសសម្ពាធឈាម',2),(220,'Drainage Péricarque','ចាក់បង្ហូរទឹកនៅស្រោមបេះដូង',2),(221,'Algie Précordiale','ឈឺចាប់នៅតំបន់ខាងមុខបេះដូង',2),(222,'Pre- Hypertension','បំរុងលើសសម្ពាធឈាម',2),(223,'Syndrome de Brugada (Maladie Genetique)','ជំងឺហ្សែននេទិចទាក់ទងនិងវិបត្តិចង្វាក់បេះដូង',2),(224,'Tachcardie supraventriculaire','វិបត្តិថតបេះដូងខាងក្រោមកន្ដ្រាក់ញាប់',2),(225,'PEC d\'un tamponnade cardiaque ','រៀបចំព្យាបាលជំងឺដក់ទឹកនៅស្រោមបេះដូង',2),(226,'Trouble vieneuse ','វិបត្តិសរសៃវ៉ែន',2),(227,'Bloc auriculo ventriculaire','ការផ្ដាច់ដោយផ្នែកឬទាំងស្រុងនៃចរន្ដរវាងថតលើនិងថតក្រោមនៃបេះដូង',2),(228,'Programmer CCO mitral chez RM très sereé','កម្មវិធីវះកាត់ត្បៀតប្រើសបេះដូងធ្ងន់ធ្ងរ',2),(229,'CArdiopathie Hypertensive','ជំងឺបេះដូងដោយសារសម្ពាធឈាមខ្ពស់',2),(230,'Tachycardie sinusale d\'origine hyperthyroidie','បេះដូងលោតញាប់បណ្ដាលមកពីជាតិពុកនៃក្រពេញក',2),(231,'NYHA II à III','កម្រិតជំងឺខ្សោយបេះដូងកម្រិត២ ដល់៣',2),(232,'Leg edema','ហើមជើង',2),(233,'Tumeur intra ventriculaire','ដុះសាច់នៅក្នុងថតបេះដូងខាងក្រោម',2),(234,'Anomalie de fermature du canal péritonéo-vaginale ','ភាពមិនប្រក្រតីនៃការបិទបំពង់រវាងស្រោមពោះនិងស្បូន',3),(235,'Anomalies des pieds ','ភាពមិនប្រក្រតីនៃប្រអប់ជើង',3),(236,'Acute appendisitis ','រលាកខ្នែងពោះវៀនស្រួចស្រាវ',3),(237,'Atrésie de l\'oesophage ','ភាពមិនប្រក្រតីពីកំណើតនៃបំពង់អាហារ',3),(238,'Boiteries','ដំណើរគ្មានលំនឹង',3),(239,'CIA (Communication inter-auriculaire)','ទំនាក់ទំនងរវាងថតបេះដូងខាងលើ',3),(240,'CIV ','ទំនាក់ទំនងរវាងថតបេះដូងខាងក្រោម',3),(241,'Coarctation de l\'aorte ','ភាពមិនប្រក្រតីនៃទម្រង់រូបរាងរបស់សរសៃឈាមអាអ័ក',3),(242,'Douleur des genoux','ឈឺចាប់នៅជង្គង់',3),(243,'Hernie diaphragmatique ','ក្លននៅស្រោមពោះខាងលើ',3),(244,'Hyperlaxité','ការធ្វើចលនាបត់បែនសន្លាក់ខ្លាំងពេក',3),(245,'Hytrocéphalie ','ក្បាលរីកធំ',3),(246,'Imperation hymenéale ','សន្ទះព្រហ្មចារីបិទជិត',3),(247,'Infection ostéo-articulaire','ការបង្ករោគនៅសន្លាក់ឆ្អឹង',3),(248,'Intoxication chey l\'enfant ','ការពុលទៅលើក្មេង',3),(249,'Invagination intestinale aigue ','ពោះវៀនលូនចូលគ្នាស្រួចស្រាវ',3),(250,'Luxation congénitale de la hanche ','ភ្លាត់សន្លាក់ត្រកៀកនិងឆ្អឹងភ្លៅពីកំណើត',3),(251,'Maladie de Hirschsprung ','ជំងឺរីកពោះវៀនធំពីកំណើត',3),(252,'Malformation ano-rectale ','ភាពមិនប្រក្រតីនៃទម្រង់រន្ធគូទ',3),(253,'Morphotypes des membres inférieures et troubles de la démarche ','វិបត្តិដំណើរដោយសារទម្រង់អវយវៈមិនធម្មតា',3),(254,'Occlusion intestinale ','ស្ទះពោះវៀនតូច',3),(255,'Pathologie du Tronc ','ជំងឺនៅនឹងបណ្ដុំសរសៃប្រសាទ',3),(256,'PCA ','ភាពនៅចំហនៃបំពង់ភ្ជាប់សរសៃឈាមអាកទែ',3),(257,'Spina bifida','ការឡើងប៉ោងនៅឆ្អឹងកងចង្កេះពីកំណើត',3),(258,'Sténose hypertrophie du pylore ','ត្បៀតដោយសាររីកសាច់ខ្ជឹបក្រពះខាងក្រោម',3),(259,'Torsion du cordon spermatique ','រមួលពងស្វាស',3),(260,'Traumatisme ostéo-articulaire','របួសទង្គិចឆ្អឹងនិងសន្លាក់',3),(261,'Compression médullaire non traumatique ','ការសង្កត់សរសៃប្រសាទខួរឆ្អឹងខ្នងដែលមិនបណ្ដាលមកពីប៉ះទង្គិច',4),(262,'Compression médullaire traumatique ','ការសង្កត់សរសៃប្រសាទខួរឆ្អឹងខ្នងដែលបណ្ដាលមកពីប៉ះទង្គិច',4),(263,'ématome extra-durale ','ដុំឈាមកកនៅក្រៅស្រោមខួរ',4),(264,'ématome intra-crânien ','កកឈាមនៅក្នុងខួរក្បាល',4),(265,'ématome sous-épidurale ','ដុំឈាមកកនៅខាងក្រោមស្រោមខួរ',4),(266,'Fracture du colonne cervicale ','បាក់ឆ្អឹងកងក',4),(267,'Fracture du rachie ','បាក់ឆ្អឹងកងខ្នង',4),(268,'Hémotome intra-crânien','ដុំឈាមកកនៅក្នុងខួរក្បាល',4),(269,'Hernie discale ','ក្លននៅទ្រនាប់ឆ្អឹងកង',4),(270,'Mal de Pott ','ជំងឺពុកឆ្អឹងដោយសាររោគរបេង',4),(271,'Malformation du rachie ','ភាពមិនប្រក្រតីនៃទម្រង់ឆ្អឹងកងខ្នង',4),(272,'Syndrome du queuse du chevale ','បណ្ដុំរោគសញ្ញានៃខួរឆ្អឹងកងចង្កេះ',4),(273,'Traumatisme cervicale ','របួសទង្គិចឆ្អឹងកងក',4),(274,'Traumatisme crânien ','របួសទង្គិចឆ្អឹងលលាដ៏ក្បាល',4),(275,'Traumatisme du colonne ','របួសទង្គិចឆ្អឹងកង',4),(276,'Tumeur cérébrale ','ដុះសាច់នៅខួរក្បាល',4),(277,'Tumeur du rachie ','ដុះសាច់នៅសរសៃប្រសាទខួរឆ្អឹងខ្នង',4),(278,'Post Traumatisme','ក្រោយគ្រោះថ្នាក់ប៉ះទង្គិច',4),(279,'Tuméfaction occipitale','ឡើងដុំប៉ោងក្បាលផ្នែកក្រោយ',4),(280,'Ancien traumatisme crânien','ធ្លាប់ប៉ះទង្គិចក្បាល',4),(281,'Tumeur cervicale','ដុះសាច់នៅក',4),(282,'Contusion cérébrale','ជាំនៅសាច់ខួរក្បាល',4),(283,'Tumeur du cuir chevelu','ដុះសាច់នៅស្បែកក្បាល',4),(284,'Lésion intra médulaire','របួសនៅក្នុងខួរឆ្អឹងខ្នង',4),(285,'Commotion cérébrale','របួសខួរក្បាលដោយសារប៉ះទង្គិច',4),(286,'Contusion hémorragique','ជាំមានហូរឈាម',4),(287,'Fracture tassement','បែកឆ្អឹងដោយកំលាំងសង្កត់',4),(288,'Hémorragie cérébral','ហូរឈាមនៅខួរក្បាល',4),(289,'Neurofibroma','ដុំនៅសរសៃប្រសាទ',4),(290,'AVC Ischémique séquellaire','សំណល់ពីគ្រោះថ្នាក់ស្ទះសរសៃឈាមខួរក្បាល',4),(291,'Lombosciatique','ឈឺចាប់សរសៃប្រសាទនៅតំបន់គូទ',4),(292,'Cranioplastic','វះកាត់ជួសជុលឆ្អឹងលលាដ៏ក្បាល',4),(293,'Hematome sous dural','ដុំឈាមកកនៅក្រោមស្រោមខួរ',4),(294,'Tassement vertébrale','បែកឆ្អឹងកងខ្នងដោយសារកំលាំងសង្កត់',4),(295,'Tuméfaction temporal','ឡើងដុំប៉ោងសៀតផ្កា',4),(296,'Acienne traumatisme crânien','ប៉ះទង្គិចក្បាលនៅកន្លែងរបួសចាស់',4),(297,'Ostéome frontal','ដុំនៅឆ្អឹងក្បាលផ្នែកខាងមុខ',4),(298,'Traumatisme du colonne lombaire','របួសទង្គិចឆ្អឹងកងចង្កេះ',4),(299,'Neurinome','ដុំនៅសរសៃប្រសាទ',4),(300,'Méningiome fronto-temporal','ដុំនៅស្រោមខួរផ្នែកខាងមុខនៃក្បាលនិងសៀតផ្កា',4),(301,'Thrombose Veineuse cérébrale ischémique','ជំងឺកំនកដុំឈាមសរសៃវ៉ៃនធ្វើអោយខូចសាច់ខួរក្បាល',4),(302,'Crânioplastie chez ancien traumatisme crânien','វះកាត់ជួសជុលឆ្អឹងលលាដ៏ក្បាលសម្រាប់អ្នកធ្លាប់មានប៉ះទង្គិចក្បាល',4),(303,'Dissectomie L5-S1','វះកាត់ទ្រនាប់ឆ្អឹងកងនៅL5-S1',4),(304,'Lésion intramédullaire','របួសនៅក្នុងខួរឆ្អឹងខ្នង',4),(305,'Contusion temporal','ជាំនៅសៀតផ្កា',4),(306,'Crêniectomie Décompressive','វះបើកឆ្អឹងលលាដ៏ក្បាលបន្ធូរសម្ពាធ',4),(307,'Hémangioblastome','ដុំស្លូតនៅក្នុងខួរក្បាល',4),(308,'Hernie Discale avec Complication','ក្លននៅទ្រនាប់ឆ្អឹងកងជាមួយផលវិបាក',4),(309,'Hématome Intra-Cérébral','ដុំឈាមកកនៅក្នុងខួរក្បាល',4),(310,'Plaie infecté post crâniectomie','របួសឆ្លងរោគក្រោយវះកាត់លលាដ៏ក្បាល',4),(311,'Tumeur cérébrale nécrosée','សាច់ដុះរលួយនៅខួរក្បាល',4),(312,'Adénome de conn','មានដុំនៅលើក្រពេញតម្រងនោម',4),(313,'Tumeur intra canalaire et extra medulaire','ដុះសាច់នៅក្នុងបំពង់ខួរឆ្អឹងនិងនៅខាងក្រៅខួរឆ្អឹងខ្នង',4),(314,'Chondrosarcome Lombaire','មហារីកឆ្អឹងខ្ចីនៅចង្កេះ',4),(315,'Ancien contusion temporal','ធ្លាប់ជាំនៅសៀតផ្កា',4),(316,'canal lombaire étroite','ត្បៀតបំពង់ឆ្អឹងកងចង្កេះ',4),(317,'Thoracic aortic aneurysm','រីកប៉ោងសរសៃឈាមអាអ័កនៅទីតាំងទ្រូង',63),(318,'Lung abscess surgery','វះកាត់បូសនៅសួត',63),(319,'Chylothorax','ដក់ទឹកនៅស្រោមសួត',63),(320,'Contusion tharacique ','ជាំនៅទ្រូង',63),(321,'Arotic dissection ','រហែកសរសៃឈាមអាអ័ក',63),(322,'Hemothorax ','ហូរឈាមនៅទ្រូង',63),(323,'Acquired diaphargmatic hernias ','ក្លននៅស្រោមពោះផ្នែកខាងលើ',63),(324,'Congenitale diaphargmatic hernias ','ក្លននៅស្រោមពោះផ្នែកខាងលើពីកំណើត',63),(325,'Esophageal cysts ','គីសនៅបំពង់អាហារ',63),(326,'Mediastinale cysts ','គីសមេឌីយ៉ាស្ទាំង',63),(327,'Mediastinitis ','រលាកមេឌីយ៉ាស្ទាំង',63),(328,'Pyothorax','ខ្ទុះនៅសួត',63),(329,'Esophageal rupture  ','ដាច់រហែកបំពង់អាហារ',63),(330,'Tracheomalacie ','ជំងឺទន់ផ្លូវដង្ហើម',63),(331,'Traumatisme du thorax','របួសទង្គិចទ្រូង',63),(332,'Blunt chest trauma ','របួសបុកផ្ទុបទៅនឹងទ្រូង',63),(333,'Benign cardiac tumors ','ដុំនៅបេះដូងមិនសូវគ្រោះថ្នាក់',63),(334,'Thymic tumors ','ដុំនៅក្នុងទ្រូង',63),(335,'Secondary lung tumors ','ដុំនៅក្នុងសួតរាលដាលមកពីសរីរាង្គផ្សេង',63),(336,'Tracheal tumors ','ដុំនៅបំពង់ខ្យល់',63),(337,'Kyste du dos','គីសនៅខ្នង',63),(338,'Kyste pleuro-péricardique','គីសនៅស្រោមសួតជុំវិញបេះដូង',63),(339,'Plaie infecté post thoracotomie','របួសឆ្លងរោគក្រោយវះកាត់ទ្រូង',63),(340,'Douleur des côtes post traumatisme ','ឈឺចាប់នៅឆ្អឹងជំនីក្រោយរបួសប៉ះទង្គិច',63),(341,'Sternotomie','វះកាត់បើកទ្រូង',63),(342,'Masse thoracique','ដុំនៅទ្រូង',63),(343,'Tumeur du thoracique','ដុះសាច់នៅទ្រូង',63),(344,'Coxarthrose ','រលាកសន្លាក់ចង្កេះ',61),(345,'Epiphysiolyse de la hanche','ភាពរលាចេញពីគ្នានៃសន្លាក់ក្បាលឆ្អឹងភ្លៅនិងឆ្អឹងត្រគាក',61),(346,'Fracture 1/3 inférieur du fémur ','បាក់ឆ្អឹងភ្លៅ1/3ផ្នែកខាងក្រោម',61),(347,'Fracture 1/3 moyen du fémur ','បាក់ឆ្អឹងភ្លៅ1/3ផ្នែកកណ្ដាល',61),(348,'Fracture base du crâne ','បាក់បាតឆ្អឹងក្បាល',61),(349,'Fracture bi-malléolaire ','បាក់ឆ្អឹងភ្នែកគោរទាំងពីរ',61),(350,'Fracture clavicule droit ','បាក់ឆ្អឹងដងកាំបិតខាងស្ដាំ',61),(351,'Fracture communitive ','ឆ្អឹងបាក់ច្រើនបំណែក',61),(352,'Fracture de Chauffeur ','​បាក់ចុងឆ្អឹងខាងក្រោមកំភួនដៃ',61),(353,'Fracture de Galéazzi','បាក់1/3ខាងក្រោមរួមនឹងភ្លាត់សន្លាក់ឆ្អឹងកំភួនដៃ',61),(354,'Fracture de la clavicule','បាក់ឆ្អឹងដងកាំបិត',61),(355,'Fracture de la diaphyse humorale ','បាក់តួឆ្អឹងដើមដៃ',61),(356,'Fracture de la jambe ','បាក់ឆ្អឹងកំភួនជើង',61),(357,'Fracture de la rotule ','បាក់ឆ្អឹងអង្គុញ',61)