ភេទB',14),(2431,'Histiocytosis','មហារីកបណ្តាលមកពីការកើនឡើងHistiocyte',14),(2432,'Hypovitaminose K','ចុះវីតាមីនខេក្នុងឈាម',14),(2433,'Antithrombin Deficiency','កង្វះអង់ទីទ្រំប៊ីន',14),(2434,'Antithrombin III Deficiency','កង្វះអង់ទីទ្រំប៊ីន ៣',14),(2435,'Alpha2-Plasmin Inhibitor Deficiency ','កង្វះអាល់ហ្វា២ផ្លាស់មីន',14),(2436,'Leukocytosis ','ការកើនឡើងគ្រាប់ឈាមសក្នុងឈាម',14),(2437,'Lymphadenopathy','ឡើងហើមនឹងឈឺនៅកូនកណ្តុរនិងសរសៃទឹករង៉ៃ',14),(2438,'Follicular Lymphoma','ហ្វូលីគីល ឡាំមហ្វូម',14),(2439,'Systemic Mastocytosis ','ភាពមិនប្រក្រតីនៃកោសិការឈាម',14),(2440,'Von Willerbrand Disease ','ជំងឺVon Willerbrand ',14),(2441,'Panctytopenia ','ជំងឺគ្រាប់ឈាមថយចុះ',14),(2442,'Extramedullary Plasmacytoma','ភាពមិនប្រក្រីនៅកោសិកា Plasma',14),(2443,'Polycythemia ','កើនឡើងគ្រាប់ឈាមក្រហម',14),(2444,'Primary Polyglobulia (Vaquer Disease)','ជំងឺវ៉ាកេរ',14),(2445,'Secondary Polyglobulia','គ្រាប់ឈាមរីកធំដោយមូលហេតុបន្ទាប់',14),(2446,'Acute Porphyria ','ប៊ហ្វីរៀល ស្រួចស្រាវ',14),(2447,'Immune Thrombocytopenic Purpura(ITP)','ជំងឺជាំបណ្តាលមកពីកង្វះប្លាកែត ប្រព័ន្តស៊ាំចុះថយ',14),(2448,'Purpura Thrombocytopénie Idiopathique(PTI) ','ជំងឺហូរឈាមបណ្តាលមកពីប្លាកែតទាប',14),(2449,'Thrombotic Thrombocytopenic Purpura ','ជំងឺកន្ទួលដោយសារប្លាកែតថយចុះ',14),(2450,'Splenomegaly ','អណ្ដើករីកធំ',14),(2451,'Bernard-Soulier Syndrome ','ចង្កោមរោគសញ្ញាឈាមក្រកក',14),(2452,'Pearson Syndrome ','ជំងឺធ្ងន់ធ្ងរដោយសារភាពមិនក្រតីនៃកោសិកាឈាម',14),(2453,'Shwachman-Diamond Syndrome ','ចង្កោមរោគសន្យាស្វាមែនដាយមិន',14),(2454,'Thrombocytopenia-Absent Radius Syndrome','ចង្កោមសញ្ញាប្លាកែតទាប',14),(2455,'Evans Syndrome','ជំងឺទាក់ទងនិងAutoimmune',14),(2456,'Hypereosinophilic Syndrome ','ជំងឺគ្រាប់ឈាមដោយសារការកើនឡើង eosinophils',14),(2457,'Megaloblastic Syndrome ','ចង្កោមរោគសញ្ញាស្លេកស្លាំងដោយការផលិតគ្រាប់ឈាមក្រហមនៅខួរឆ្អឹងមិនប្រក្រតី',14),(2458,'Splenomegaly Syndrome ','ចង្កោមរោគសញ្ញាជំងឺអណ្ដើករីក',14),(2459,'Hemolytic-Uremic Syndrome ','ចង្កោមរោគសញ្ញានោមឈាម',14),(2460,'Thalassémie intermittent ','ស្លេកស្លាំកម្រិតមធ្យម',14),(2461,'Secondary Thrombocytosis','ការកើនឡើងប្លាកែត',14),(2462,'Immune Thrombocytopenia and Pregnancy','ប្លាកែតចុះទាបចំពោះស្រ្តីមានផ្ទៃពោះ',14),(2463,'Heparin-Induced Thrombocytopenia ','ប្លាកែតចុះទាបដោយសារអេប៉ារីន',14),(2464,'Renal Vein Thrombocytosis','កំណកឈាមនៅសរសៃវ៉ែនក្នុងតម្រងនោម',14),(2465,'Thromboembolism','ស្ទះសរសៃឈាមដោយសារកំណកឈាម',14),(2466,'Thrombopenia','ការថយចុះប្លាកែត',14),(2467,'Superficial Thrombophlebitis ','ស្ទះសរសៃឈាមវ៉ែន',14),(2468,'Internal Jugular Vein Thrombosis','ឡើងប៉ោងសសៃវ៉ែននៅក',14),(2469,'Thromboses Récidivantes ','ស្ទះកំណកឈាមម្ដងទៀត',14),(2470,'Arsine Poisoning','ការកើនឡើងជាតិពុលក្នុងឈាម',14),(2471,'Alloimmunization From Transfusions ','បញ្ចូលឈាមសម្រាប់ស្រ្ដីមានផ្ទៃពោះ',14),(2472,'Anemia of Chronic Disease and Renal Failure','ជំងឺស្លេកស្លាំងរ៉ាំរ៉ៃ និងខ្សោយតម្រងនោម',14),(2473,'Aplastic Anemia ','ជំងឺស្លេកស្លាំង Asplastic',14),(2474,'Bone Marrow Failure ','កង្វះគ្រាប់ឈាមក្នុងខួរឆ្អឹង',14),(2475,'Erythroleukemia','មហារីកគ្រាប់ឈាមស',14),(2476,'Erythromelalgia','គ្រាប់ឈាមក្រហមរីកធំ',14),(2477,'Essential Thrombocytosis','ជំងឺវិបត្តិប្លាកែត',14),(2478,'Familial Renal Amyoidosis ','ជំងឺអាមីឡូអ៊ីតតម្រង់នោមតពូជ',14),(2479,'Folic Acid Deficiency ','ការថយចុះ Folic Acid',14),(2480,'Gamma Heavy Chain Disease ','ជំងឺវិបត្តិគ្រាប់ឈាម',14),(2481,'Glanzmann Thrombasthenia ','ចង្កោមរោគសញ្ញាប្លាកែតក្លែនស្មែន',14),(2482,'Glucose-6-Phosphate Dehydrogenase Deficiency(G6PD)','កង្វះអង់ហ្សីមG6PD',14),(2483,'Hemoglobin C Disease ','ជំងឺហេម៉ូក្លូប៊ីនស៊ី',14),(2484,'Hemolytic Anemia ','ស្លេកស្លាំងដោយសារបែកគ្រាប់ឈាម',14),(2485,'Hereditary Elliptocytosis ','ជំងឺគ្រាប់ឈាមរាងអេលីត',14),(2486,'Hereditary Pyropoikilocytosis ','ជំងឺគ្រាប់ទម្រង់គ្រាប់ឈាម',14),(2487,'Hereditary Spherocytosis','ជំងឺគ្រាប់ទម្រង់គ្រាប់ឈាមរាងស៊្វែរ',14),(2488,'Intravenous Immunoglobulin ','អ៊ីម៉ុយណូក្លូប៊ុយលីនក្នុងសរសៃឈាមវ៉ែន',14),(2489,'Iron Deficiency Anemia ','ស្លេកស្លាំងដោយសារកង្វះជាតិដែក',14),(2490,'Light Chain-Associated Renal Disorders ','ជំងឺវិបត្តិគ្រាប់ឈាមគួបផ្សំជំងឺតម្រង់នោម',14),(2491,