,'ខ្សោយតម្រង់នោមរ៉ាំរ៉ៃនិងលាងឈាម',20),(2709,'Lupus érythèmateux Disséminé','ជំងឺលុយពីស',20),(2710,'Tubulointerstitial diseases of the kidney ','ជំងឺបំពង់បង្ហូររបស់តម្រង់នោម',20),(2711,'Mladie Rénale Chronique ','ជំងឺតម្រង់នោមរ៉ាំរ៉ៃ',20),(2712,'Néphrite interstielle ','រលាកភ្នាសតម្រង់នោម',20),(2713,'Diabetic nephropathy ','ជំងឺទឹកនោមផ្អែមបណ្តាលមកពីតម្រង់នោម',20),(2714,'Néphropathie Vasculaire','ជំងឺសរសៃឈាមតម្រង់នោម',20),(2715,'Nephrosclerosis','ជំងឺតម្រង់នោមក្រិន',20),(2716,'Nréphropathie Diabètique ','ជំងឺទឹកនោមផ្អែមបណ្តាលមកពីតម្រង់នោម',20),(2717,'Nréphropathie Glomérulaire ','ជំងឺតម្រង់នោមបណ្តាលមកពីក្លូម៉េរ៉ុល',20),(2718,'Polykystose Rénale ','ជំងឺគីសច្រើននៅតម្រង់នោម',20),(2719,'Protéinurie et Syndrome Nréphrotique ','ចង្កោមរោគសញ្ញាទឹកនោមប្រៃ',20),(2720,'Rein du Sujet Agé','តម្រង់នោមរបស់មនុស្សចាស់',20),(2721,'Sténose artèrielle rénale ','ត្បៀតសរសៃឈាមក្រហមតម្រង់នោម',20),(2722,'Hepatorenal syndrome ','ចង្កោមរោគសញ្ញាថ្លើម និងតម្រង់នោម',20),(2723,'Syndrome Oedémateux','ចង្កោមរោគសញ្ញាហើម',20),(2724,'Toxicité médicamemteux ','ពុលដោយសារធាតុថ្នាំ',20),(2725,'Colique néphrétique','ចុកតម្រង់នោម',20),(2726,'Pyonéphrose','ខ្ទុះតម្រង់នោម',20),(2727,'Pyélonéphrite obstructive','រលាកតម្រង់នោមបណ្តាលមកពីការស្ទះ',20),(2728,'Glomérulonéphrite Chronic','ជំងឺរលាកក្លូម៉េរុលតម្រង់នោមរ៉ាំរ៉ៃ',20),(2729,'Benign prostatic hypertrophy','ក្រពេញប្រូស្តាតរីកកម្រិតស្រាល',20),(2730,'Nephrotic Syndrom','ចង្កោមរោគសញ្ញារលាកតម្រងនោម',20),(2731,'Syndrome néphrotique','ចង្កោមរោគសញ្ញារលាកតម្រងនោម',20),(2732,'Syndrome néphrotique impure','ចង្កោមរោគសញ្ញារលាកតម្រងនោមលាយឡំគ្នា',20),(2733,'Syndrome glomérulaire','ចង្កោមរោគសញ្ញារលាក្លូម៉េរុល',20),(2734,'Brain Abcess','បូសខួរក្បាល',21),(2735,'Transient ischemic attack(TIA)','វិបត្តិសរសៃឈាមខួរក្បាលរយៈពេលខ្លី',21),(2736,'Accident Vasculaire cérébraux (AVC)','គ្រោះថ្នាក់សរសៃឈាមខួរក្បាល',21),(2737,'Cerebral Aneurysms','សរសៃឈាមខួរក្បាលរីក',21),(2738,'Cerebral Amyloid Angiopathy','ជំងឺអាមីឡូសលើសរសៃឈាមខួរក្បាល',21),(2739,'Arthérite inflammatoire de Horton','ជំងឺរលាកសរសៃឈាមក្រហមហរតុន',21),(2740,'Vertebral Artery Artherothrombosis','កំណកឈាមលើសរសៃឈាមក្រហមឆ្អឹងខ្នង',21),(2741,'Cerebellar Atrophy','តំបន់សេរ៉ប៊ែឡឺរូមតូច',21),(2742,'Cerebral Atrophy','ស្វិតកោសិកាខួរក្បាល',21),(2743,'Cardioembolic Stroke','វិបត្តិសរសៃឈាមខួរក្បាលដោយសារបេះដូង',21),(2744,'Cécité corticale ','ពិការភ្នែក',21),(2745,'Chorea ','អាសន្នរោគ',21),(2746,'Chorée de Huntington','ជំងឺកូរ៉េហាន់ទីងតុន',21),(2747,'Coma ','សន្លប់',21),(2748,'Coma non Traumatism ','សន្លប់ដោយមិនមានការប៉ះទង្កិច',21),(2749,'Sida neuropathy complication','ផលវិបាកប្រព័ន្ធប្រសាទនៃជំងឺអេដស៍',21),(2750,'Complication neurologique de l\'alcoolisme ','ផលវិបាកប្រព័ន្ធប្រសាទនៃជំងឺញៀនសុរា',21),(2751,'Spinal Cord Compression ','គៀបប្រសាទឆ្អឹងកងខ្នង',21),(2752,'Compression médullaire non traumatique ','គាបសង្កត់ខួរឆ្អឹង',21),(2753,'Cerebral Cysticercosis','ជំងឺប៉ារ៉ាស៊ីតខួរក្បាល',21),(2754,'Dementia ','បាត់បង់ការចងចាំ ',21),(2755,'Vertical Binocular Diplopie ','វិបត្តិសរសៃវិញ្ញាភ្នែក',21),(2756,'Atypical Facial Pain','ឈឺសរសៃវិញ្ញាមុខ',21),(2757,'Dystonia','ចលនាអឆន្ទៈសាច់ដុំ',21),(2758,'Cervical Dystonia ','ចលនាអឆន្ទៈសាច់ដុំកងក',21),(2759,'Encephalitis ','រលាកស្រោមខួរក្បាល',21),(2760,'Tuberculosis encephalitis ','របេងស្រោមខួរក្បាល',21),(2761,'Herpes Encephalitis ','រលាកខួរក្បាលដោយមេរោគអ៊ែរប៉ែស',21),(2762,'Uremic Encephalopathy','ពុលខួរក្បាលដោយសារធាតុអ៊ុយរ៉េ',21),(2763,'Epilepsie ','ជំងឺឆ្កួតជ្រូក',21),(2764,'Hématome épidural ','ឈាមកស្រោមខួរក្បាល',21),(2765,'Hématome extra-durale ','ដុំឈាមក្រៅស្រោមខួរក្បាល',21),(2766,'Spinal Hematoma ','ដុំឈាមនៅខួរឆ្អឹងខ្នង',21),(2767,'Hématome sous-durale aigue ','ដុំឈាមក្រោមស្រោមខួរក្បាលស្រួចស្រាវ',21),(2768,'Hématome sous-durale Chronique ','ដុំឈាមក្រោមស្រោមខួរក្បាលរាំរ៉ៃ',21),(2769,'Hemiplegia ','ពិការមួយកំនាត់ខ្លួនចុះក្រោម',21),(2770,'Cerebellar Hemorrhage','ហូរឈាមខួរតូច',21),(2771,'Spontaneous Intracerebral Hemarrhage ','ហូរឈាមដោយឯងៗនៅក្នុងខួរតូច',21),(2772,'Hémorragie méningée','ហូរឈាមក្នុងស្រោមខួរក្បាល',21),(2773,'Hémorragie méningée tramatique ','ហូរឈាមក្នុងស្រោ