,58),(4855,'Pyodermatite','ជំងឺស្បែកមានខ្ទុះ',58),(4856,'Rétention urinaire ','ចាល់ទឹកនោមក្នុងផ្លោកនោម',58),(4857,'Torsion testiculaire ','រមួលពងស្វាស',58),(4858,'Ablation de sonde JJ','វះកាត់ដកយកស៊ុងទឹកនោមJJ',58),(4859,'Normal','ធម្មតា',58),(4860,'Tumeur du rein','ដុំនៅតម្រងនោម',58),(4861,'Orchite épididymite','រលាកបំពង់មេជីវិតនៅពងស្វាស',58),(4862,'Sténose urétéral','ត្បៀតបំពង់បង្ហូរទឹកនោម',58),(4863,'Calcul vésicale','គ្រួសនៅផ្លោកនោម',58),(4864,'Rétention aigue d\'urine','ចាល់ទឹកនោមស្រួចស្រាល',58),(4865,'Dilatation des cavités pyélocalicielles','រីកប្រហោងបំពង់បង្ហូរទឹកនោមនៅនឹងតម្រងនោម',58),(4866,'Sténoses de l\'urètre','ត្បៀតបំពង់បង្ហូរទឹកនោម',58),(4867,'Calcul pré-vésical droite','គ្រួសនៅពីមុខផ្លោកនោមខាងស្ដាំ',58),(4868,'Calcul pré-vésical gauche','គ្រួសនៅពីមុខផ្លោកនោមខាងឆ្វេង',58),(4869,'Pyélonéphrite obstructive pour calcul pyélique','រលាកសាច់តម្រងនោមដោយសារមានគ្រួសស្ទះ',58),(4870,'Kyste épididyme','គីសនៅបំពង់មេជីវិត',58),(4871,'Suivi d\'une Syndrome Nephrotique','បណ្ដុំរោគសញ្ញានៃជំងឺតម្រងនោម',58),(4872,'Néphrostomie','វះកាត់តម្រងនោម',58),(4873,'Pyélonéphrite aiguë à E-Coli','រលាកសាច់តម្រងនោមស្រួចស្រាលដោយសារមេរោគ E-Coli',58),(4874,'Urétrite et Phymosis','រលាកបំពង់បង្ហូរទឹកនោម និងមានស្បែកគ្របក្បាលលិង្គជិត',58),(4875,'Dysfunctional Urine Bleeding','វិបត្តិនោមឈាម',58),(4876,'Dilatation pyélocalicielle','រីកប្រហោងបំពង់បង្ហូរទឹកនោមនៅនឹងតម្រងនោម',58),(4877,'Mass du scrotum','មានដុំនៅពងស្វាស',58),(4878,'Kyste de l\'épididyme','គីសនៅបំពង់មេជីវិត',58),(4879,'Abccès du rein droit','ករខ្ទុះនៅតម្រងខាងស្ដាំ',58),(4880,'Overactive bladder','ឈឺនោមភ្លាមៗដោយសារការកន្ដ្រាក់ផ្លោកនោមខ្លាំង',58),(4881,'Overactive bladder','ឈឺនោមភ្លាមៗដោយសារការកន្ដ្រាក់ផ្លោកនោមខ្លាំង',58),(4882,'Uréthrite','រលាកបំពង់បង្ហូរទឹកនោម',58),(4883,'Microcalcul D/G Sans Stase Urinaire','គ្រួសតូចៗមិនបង្ករអោយស្ទះនោម',58),(4884,'Lésion de la verge','ដំបៅនៅប្រដាប់ភេទបុរស',58),(4885,'Sydrome de jonction urétéro-pyélique','បណ្ដុំរោគសញ្ញានៅចំនុចភ្ជាប់រវាងបំពង់បង្ហូរនិងតម្រងនោម',58),(4886,'Infection Urinaire + Fibrom