INSERT INTO `form_document` VALUES (8,'2024-08-05 11:58:27','លិខិស្នើរសុំចេញពីពេទ្យ	','<p class=\"MsoNormal\" style=\"text-indent:36.0pt\"><span lang=\"KHM\" style=\"font-size:\r\n12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:KHM\"></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-size: 14px;\">﻿</span><span>﻿</span><span lang=\"KHM\" style=\"font-size:14.0pt;font-family:&quot;Khmer OS Muol&quot;;mso-bidi-language:KHM\">លិខិស្នើរសុំចេញពីពេទ្យ</span><span style=\"font-size:14.0pt;font-family:&quot;Khmer OS Muol&quot;;mso-bidi-language:KHM\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:36.0pt\"><span lang=\"KHM\" style=\"font-size:\r\n12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:KHM\">ខ្ញុំបាទ/នាងខ្ញុំឈ្មោះ........................................ភេទ......................អាយុ\r\n.............ឆ្នាំ</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">សញ្ជាតិ...................................................លេខទូរស័ព្ទ.....................................................................</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">មុខរបរ.....................................................អង្គភាព........................................................................</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">អាសយដ្ឋាន.......................................................................................................................................</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">ត្រូវជា............................................................................................................................................</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">អ្នកជំងឺឈ្មោះ.........</span><span style=\"font-size:\r\n12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:KHM\">tbpatient(name_khmer)<span lang=\"KHM\">......................................................................................</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">សញ្ជាតិ...................................................លេខទូរស័ព្ទ........................................................................</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language:KHM\">ដែលបានចូលសម្រាកព្យាបាលនៅថ្ងៃទី........</span><span style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;mso-bidi-language:\r\nKHM\">date_visit………time<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"KHM\" style=\"font-size:12.0pt;font-family:&quot;Khmer OS Battambang&quot;;\r\nmso-bidi-language: