INSERT INTO `imagerie_request` VALUES (225,496,'		<p style=\"text-align:center;\"><span style=\"font-family:KhmerOSMuol;\">ពិនិត្យផ្ទៃពោះត្រីមាសទី២ និង ត្រីមាសទី៣</span></p><p style=\"text-align:center;\">ប្រវត្តិរដូវចុងក្រោយថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span>គ្រប់សម្រាលប្រហែល<span style=\"color:#0000ff;\">&nbsp;</span>ថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span></p><figure class=\"table\"><table><tbody><tr><td>ប្រវត្តិផ្ទៃពោះលើកទី</td><td><span style=\"color:#0000ff;\">00</span></td></tr><tr><td>ប្រវត្តិសម្រាលកូនដោយ&nbsp;</td><td>សម្រាលធម្មតា&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>ដង/​ វះកាត់&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>/ រលូត&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>ដង</td></tr><tr><td>ចំនួនទារកក្នុងផ្ទៃ</td><td><span style=\"color:#0000ff;\">០២</span></td></tr></tbody></table></figure><p style=\"text-align:center;\"><span style=\"color:#0000ff;\">តារាងពិនិត្យទារក</span></p><figure class=\"table\"><table><tbody><tr><td>ទារក</td><td>ទារកទី១</td><td>ទារកទី២</td><td>ទារកទី៣&nbsp;</td></tr><tr><td>សុខភាពទារក</td><td>ល្អ</td><td>ល្អ</td><td>ល្អ&nbsp;</td></tr><tr><td>ទីតាំងសុក</td><td>នៅខាងក្រោយឈាងខាងស្តាំ</td><td>នៅខាងក្រោយឈាងខាងស្តាំ&nbsp;</td><td>នៅខាងក្រោយឈាងខាងស្តាំ&nbsp;</td></tr><tr><td>បរិមាណទឹកភ្លោះ</td><td>មធ្យម</td><td>មធ្យម</td><td>មធ្យម&nbsp;</td></tr><tr><td>ចង្វាក់បេះដូង</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)&nbsp;</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)&nbsp;</td></tr><tr><td>ការលូតលាស់ និងចលនាទារក</td><td><p>ល្អធម្មតា លូតលាស់ទៅតាមអាយុទារក</p><p>មានរលនាធម្មតា</p></td><td><p>ល្អធម្មតា លូតលាស់ទៅតាមអាយុទារក</p><p>មានរលនាធម្មតា</p></td><td><p>ល្អធម្មតា លូតលាស់ទៅតាមអាយុទារក</p><p>មានរលនាធម្មតា</p></td></tr><tr><td>ទម្រ