n style=\"color:#0000ff;\">00</span>&nbsp;ថ្ងៃ</td><td><span style=\"color:#0000ff;\">00</span>&nbsp;សប្តាហ៍&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ថ្ងៃ</td></tr><tr><td>ទារកគ្រប់ខែសម្រាលតាមអេកូ</td><td>ថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span>មុនក្រោយ<span style=\"color:#0000ff;\">&nbsp;០៧ថ្ងៃ</span></td><td>ថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span>មុនក្រោយ<span style=\"color:#0000ff;\">&nbsp;០៧ថ្ងៃ</span>&nbsp;</td><td>ថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span>មុនក្រោយ<span style=\"color:#0000ff;\">&nbsp;០៧ថ្ងៃ</span>&nbsp;</td></tr><tr><td>ការសន្និដ្ឋាន</td><td><p>សុភាពទាករល្អ,ពុំមានទងសុករុំកទេ</p><p>ណាត់ជួពិនិត្យនៅ&nbsp;<span style=\"background-color:transparent;color:inherit;\">ថ្ងៃទី&nbsp;</span><span style=\"color:#0000ff;\">00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ខែ</span><span style=\"color:#0000ff;\">&nbsp;00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ឆ្នាំ&nbsp;</span><span style=\"background-color:transparent;color:#0000ff;\">2025</span></p></td><td><p>សុភាពទាករល្អ,ពុំមានទងសុករុំកទេ</p><p>ណាត់ជួពិនិត្យនៅ&nbsp;<span style=\"background-color:transparent;color:inherit;\">ថ្ងៃទី&nbsp;</span><span style=\"color:#0000ff;\">00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ខែ</span><span style=\"color:#0000ff;\">&nbsp;00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ឆ្នាំ&nbsp;</span><span style=\"background-color:transparent;color:#0000ff;\">2025</span></p></td><td><p>សុភាពទាករល្អ,ពុំមានទងសុករុំកទេ</p><p>ណាត់ជួពិនិត្យនៅ&nbsp;<span style=\"background-color:transparent;color:inherit;\">ថ្ងៃទី&nbsp;</span><span style=\"color:#0000ff;\">00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ខែ</span><span style=\"color:#0000ff;\">&nbsp;00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ឆ្នាំ&nbsp;</span><span style=\"background-color:transparent;color:#0000ff;\">2025</span></p></td></tr></tbody></table></figure><p style=\"text-align:center;\"><span style=\"color:fuchsia;\">ចំណាំ&nbsp;៖ ការពិនិត្យអេកូមិនអាចកំណត់ភាពមិនប្រក្រតីរបស់ទារកក្នុងផ្ទៃ ១០០% បានទេ ។</span></p>\r\n	',1,142,'2024-08-22 14:25:06'),(226,566,'	<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers.</p><p>Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: hypertendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.</p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.</p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Cholécystite.</p>\r\n',1,142,'2024-08-21 10:11:07'),(227,571,'	<p>=&gt;ថ្លើម : ទំហំថ្លើមធម្មតា ,សាច់ថ្លើមទន់ហើយរលោងស្មើរសាច់ ,ពុំមានដុំនៅក្នុងថ្លើមទេ ។</p><p>=&gt;ប្រព័ន្ធឈាមខ្មៅ(Veine Porte et VSH)ទំហំធម្មតា ។</p><p>=&gt;ថង់ទឹកប្រមាត់ : កំរាស់ធម្មតាស្មើរសាច់ ,ពុំមានដុំគ្រួស ឬ ដុំសាច់ទេ ។</p><p>=&gt;លំពែង : ទំហំ ,ប្រវែង ,សាច់ របស់លំពែងធម្មតា ។</p><p>=&gt;តម្រងនោមខាងស្តាំ : ទំហំប្រវែងធម្មតា មិនមានរីកតម្រងនោម មិនមានការស្ទះនៅបង្ហូរនោម ,ពុំមានដុំសាច់ និង ពុំមានគ្រួស ។</p><p>=&gt;តម្រងនោមខាងឆ្វេង :ទំហំប្រវែងធម្មតា មិនមានរីកតម្រងនោម មិនមានការស្ទះនៅបង្ហូរនោម ,ពុំមានដុំសាច់ និង ពុំមានគ្រួស ។</p><p>=&gt;អណ្តើក : មានទំហំធម្មតា ។</p><p>=&gt;ប្លោកនោម : កំរាស់ធម្មតា ហើយរលោង ។</p><p>=&gt;ក្រពេញប្រូស្តាត : មានទំហំធម្មតា ។</p><p>=&gt;បាតរបស់ពោះ : ធម្មតា ពុំមានទឹកទេ (Cul-de-sac Douglas libre)។</p><p>======&gt;សេចក្តីសន្និដ្ឋាន : ធម្មតា ។</p>\r\n',1,142,'2024-08-21 10:11:23'),(228,562,'	<p style=\"text-align:center;\">ពិនិត្យផ្ទៃពោះត្រីមាសទី២ និង ត្រីមាសទី៣</p><p style=\"text-align:center;\">ប្រវត្តិរដូវចុងក្រោយថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span>គ្រប់សម្រាលប្រហែល<span style=\"color:#0000ff;\">&nbsp;</span>ថ្ងៃទី&nbsp;<span style=\"color:#0000ff;\">00</span>&nbsp;ខែ<span style=\"color:#0000ff;\">&nbsp;00</span>&nbsp;ឆ្នាំ&nbsp;<span style=\"color:#0000ff;\">2025&nbsp;</span></p><figure class=\"table\"><table><tbody><tr><td>ប្រវត្តិផ្ទៃពោះលើកទី</td><td><span style=\"color:#0000ff;\">00</span></td></tr><tr><td>ប្រវត្តិសម្រាលកូនដោយ<br>&nbsp;</td><td>សម្រាលធម្មតា&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>ដង/​ វះកាត់&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>/ រលូត&nbsp;<span style=\"color:rgb(0,0,255);\">00</span>ដង</td></tr><tr><td>ចំនួនទារកក្នុងផ្ទៃ</td><td><span style=\"color:#0000ff;\">០២</span></td></tr></tbody></table></figure><p style=\"text-align:center;\"><span style=\"color:#0000ff;\">តារាងពិនិត្យទារក</span></p><figure class=\"table\"><table><tbody><tr><td>ទារក</td><td>ទារកទី១</td><td>ទារកទី២</td><td>ទារកទី៣<br>&nbsp;</td></tr><tr><td>សុខភាពទារក</td><td>ល្អ</td><td>ល្អ</td><td>ល្អ<br>&nbsp;</td></tr><tr><td>ទីតាំងសុក</td><td>នៅខាងក្រោយឈាងខាងស្តាំ</td><td>នៅខាងក្រោយឈាងខាងស្តាំ<br>&nbsp;</td><td>នៅខាងក្រោយឈាងខាងស្តាំ<br>&nbsp;</td></tr><tr><td>បរិមាណទឹកភ្លោះ</td><td>មធ្យម</td><td>មធ្យម</td><td>មធ្យម<br>&nbsp;</td></tr><tr><td>ចង្វាក់បេះដូង</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)<br>&nbsp;</td><td>000 ដង/នាទី (១២០ដល់១៦០ ដង/នាទី)<br>&nbsp;</td></t