INSERT INTO `template` VALUES (1,'Occlusif de l\'intestin (F)','<p>-FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers.</p><p>         Absence de nodule décelable dans le parenchyme hépatique.    </p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable. </p><p>- VÉSICULE BILIAIRE:normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: normal .</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>-Anse de l\'intestin sont dilaté </p><p>* CONCLUSION:Syndrome occlusif de l\'intestin.</p>'),(2,'HYDROCHOLECYSTE + ADENOME PROSTATIQUE (M)','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi épaissie en feuilleté de 6mm d’épaisseur et régulière,contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE : Hypertrophié, mesurent 34.6mm×47.2mm, structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p></p><p>*** CONCLUSION: -HYDROCHOLECYSTE </p><p>                -ADENOME PROSTATIQUE</p>'),(3,'Thyroïde','<p>- Le lobe droit mesure   mm x  mm x  mm.</p><p>- Le lobe gauche mesure   mm x  mm x  mm.</p><p>- L\'isthme mesure   mm en longitudinal et   mm en antéro-postérieur.</p><p>- L\'échostructure glandulaire est homogène.</p><p>- L\'échogénicité est normale. Les contours de l\'isthme et de chaque lobe sont réguliers.</p><p>- Absence d\'adénopathie le long des axes jugulo-carotidiens.</p><p>- Pas d\'argument en faveur d\'une pathologie para-thyroidienne.</p><p></p><p>*** CONCLUSION:Echographie thyroidienne normale.</p>'),(4,'Endomètrite','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>       Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS : collection liquide dans la cavité utérus. </p><p>- ANNEXES : sont normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p></p><p>*** CONCLUSION: Hématomètrie / Eo Endomètrite .</p>'),(5,'HENIE DE L\'INGUINALE DROIT (M)','<p>-FOIE  taille normale, structure fine et homogène, surface lisse avec contours réguliers.</p><p>         Absence de nodule décelable dans le parenchyme hépatique.    </p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable. </p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: normal .</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>-De l\'inguinale droit prèsence d\'l zone hypo èchogène avec chine par aire.</p><p>*** CONCLUSION: -HENIE DE L\'INGUINALE DROIT</p>'),(6,'Goitre nodulaire lobe (D)','<p>Echographie de la glande thyroïde: structure homogène.</p><p>- Lobe droit : hypertrophie, contenent d’une nodule de 19mm×17mm . </p><p>               borde régulier .</p><p>- Lobe gauche: normale </p><p>- Isthme=normale </p><p>-Absence de calcification. </p><p></p><p>*** CONCLUSION: Goitre nodulaire lobe D .</p>'),(7,'Goitre kystique','<p>Echographie de la glande thyroïde: structure homogène.</p><p>- Lobe droit : de 8mm d\'épaisseur et de 12mm de largueur. </p><p>- Lobe gauche: Présence d\'une kyste mesurant 16mm×18mm </p><p>- Isthme=18mm </p><p>-Absence de calcification. </p><p></p><p>*** CONCLUSION: Goitre kystique</p>'),(8,'Kyste du thyroide lobe gauche','<p>Echographie de la glande thyroïde: structure homogène.</p><p>- Lobe droit : structure normale .6mm d\'épaisseur et de 20mm de largueur</p><p>- Lobe gauche: de 7mm d\'épaisseur et de 21mm de largueur et présance d’une kyste mesurant 160mm×14mm.</p><p>- Isthme normale . </p><p></p><p>*** CONCLUSION: kyste du thyroide lobe gauche .</p>'),(9,'ASCITE (M)','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE : volume, forme et structure normaux.</p><p>- ASCITE de grand abondant .</p><p>*** CONCLUSION: ASCITE DE GRAND ABONDANT.</p>'),(10,'DES SEINS','<p>Examen clinique:</p><p>-Des deux seins sont symétriques</p><p>-Absence d`écoulement mammaire à la pression</p><p>-Absence de cicatrice ou rétraction cutané</p><p>Echographie:</p><p>-Des deux seins sont de morphologie normale.</p><p>-Absence d`adénopathie axillaire.</p><p></p><p>*** CONCLUSION:Echographie des seins normale.</p>'),(11,'ÉCHOGRAPHIE THYROÏDIENNE:','<p>- La thyroïde présente les dimensions suivantes :</p><p>- Lobe droit : mm de haut, mm d’épaisseur, mm de large.</p><p>- Lobe gauche :  mm de haut, mm d’épaisseur, mm de large.</p><p>- Isthme : mm d’épaisseur.</p><p>- Les contours sont réguliers( déformés dans la région para-isthmique gauche, droite par une formation nodulaire).</p><p>- L’échostructure est homogène  ( hétérogène avec individualisation de multiples formations nodulaires hypoéchogène)</p><p>- Du côté droit, on retient un nodule.</p><p>- Du côté gauche, on retrouve .</p><p>- Absence d\'adénopathie le long des axes jugulo-carotidiens.</p><p>- Pas d\'argument en faveur d\'une pathologie para-thyroidienne.</p><p></p><p>*** CONCLUSION : Echographie thyroidienne normale.</p>'),(12,'Echographie abdomino-pelvienne (Femme)','<p>- Le foie est de taille normale (foie droit à   mm sur la ligne médio-claviculaire et le foie gauche </p><p>  à mm sur la coupe sagittale), de contours réguliers, d\'écho-structure homogène dans son ensemble.</p><p>- Les systèmes veineux(porte et sus hépatiques) sont libre et de calibre normal.</p><p>- La vésicule biliaire est alithiasique,de taille normal, à parois fines.</p><p>- Les voies biliaires intra et extra hépatiques ne sont pas dilatées.</p><p>- Le pancréas est de tailles normales, de contours réguliers.Absence de dilatation du canal de Wirsung. </p><p>- La rate est homogène, de taille normale. </p><p>- Les  reins deux reins sont de taille et d’échostructure normale (rein droit mesure  mm </p><p>  et rein gauche mesure  mm), absence de calcul ni dilatations des cavités pyélocalicielles.</p><p>- Utérus de position antéversé, de taille   mm de longueur, de  mm d’épaisseur, de contours </p><p>  réguliers, de structure homogène du myomètre avec ligne de vacuité régulière.</p><p>- Ovaire droit : absence d’anomalie décelée.</p><p>- Ovaire gauche :absence d’anomalie décelée.</p><p>- La vessie présente un contenu anéchogène sans épaississement de la paroi, ni diverticule ni lithiase.</p><p>- Le cul-de-sac de Douglas : libre.</p><p></p><p>*** Conclusion : </p><p>    - Echographie abdomino-pelvienne actuellement  normale</p>'),(13,'Echographie abdomino-pelvienne (Homme)','<p>- Le foie est de taille normale (foie droit à  mm   sur la ligne médio-claviculaire et le foie gauche </p><p>  à mm sur la coupe sagittale, de contours réguliers, d\'écho-structure homogène dans son ensemble.</p><p>- Les systèmes  veineux (porte et sus hépatiques) sont libre et de calibre normal.</p><p>- La vésicule biliaire est alithiasique,de taille normal, à parois fines.</p><p>- Les voies biliaires intra et extra hépatiques ne sont pas dilatées.</p><p>- Le pancréas est de tailles normales, de contours réguliers.Absence de dilatation du canal de Wirsung. </p><p>- La rate est homogène, de taille normale. </p><p>- Les  reins deux reins sont de taille et d’échostructure normale (rein droit </p><p>  mesure  mm et rein gauche mesure  mm .), absence de calcul  ni dilatations des cavités pyélocalicielles.</p><p>- La prostate qui soulève discrètement le plancher vésical est mesurée à       cm x      cm x     cm </p><p>  ce qui correspond à environ      g. </p><p>- La vessie présente un contenu  anéchogène sans épaississement de la paroi , ni  diverticule  ni lithiase.</p><p>- Le cul de sac de Douglas : libre.</p><p></p><p>*** Conclusion : </p><p>    - Echographie abdomino-pelvienne  actuellement  normale.</p>'),(14,'NORMAL MASCULIN','<p>- FOIE:  taille normale, structure fine et homogène, surface lisse avec contours réguliers.</p><p>         Absence de nodule décelable dans le parenchyme hépatique.    </p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable. </p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: normal .</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Echographie abdomino-pelvienne normale.</p>'),(15,'NORMAL FEMME','<p>- FOIE:  taille normale, structure fine et homogène, surface lisse avec contours réguliers.</p><p>         Absence de nodule décelable dans le parenchyme hépatique.    </p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable. </p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: normal .</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS et ANNEXES: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Echographie abdomino-pelvienne normale.</p>'),(16,'LECYSTITE LITHIASIQUE (M)','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi épaissie en feuilleté de 6mm d’épaisseur et régulière,contenu anéchogène.Présence d’un calcul de 10mm x 20mm de diamètre.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE : volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Cholécystite lithiasique.</p>'),(17,'CHOLECYSTITE LITHIASIQUE (F)','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi épaissie en feuilleté de 5mm d’épaisseur et régulière,contenu anéchogène.Présence d’un calcul de 10mm x 20mm de diamètre.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS et ANNEXES : sont normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Cholécystite lithiasique.</p>'),(18,'POLYPE VÉSICULE BILIAIRE (F)','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: hypertendue, Prèsence quelque mass hyper èchogène diamètre 9,2mm, 8,6mm .</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS et ANNEXES : sont normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: POLYPE VÉSICULE BILIAIRE.</p>'),(19,'LITHIASE VESICULAIRE (F) VB','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>       Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière, contenant d’un calcul de 8mm de grand axe.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS et ANNEXES: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Lithiase vésiculaire non compliquée.</p>'),(20,'LITHIASE VESICULAIRE (M) VB','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours régu