le dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS: antéversé et augmenté de volume, présence d\'une image à l\'échostruture</p><p>         est moins échogène que l\'échostruture du myomètre 10cm×8cm de diamétre.</p><p>- ANNEXES : nomaux</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Fibromyome.</p>'),(63,'KYSTE DE L\'OVAIRE D','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales. </p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS: normale.</p><p>- ANNEXES : Présence d’une formation kystique anéchogène à paroi fine avec contours bien limité,</p><p>  mesurant 56mm x 34mm, situé à droite de l’utérus.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Kyste de l’ovaire droite.</p>'),(64,'KYSTE DE L\'OVAIRE G','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS: normale.</p><p>- ANNEXES : Présence d’une formation kystique anéchogène à paroi fine avec contours bien limité, </p><p>  mesurant 22mm x 26mm, situé à gacuhe de l’utérus.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: -Kyste fonctionelle de l’ovaire gauche.</p>'),(65,'KYSTE DE L\'OVAIRE G ET D','<p>- FOIE: taille normale, structure fine et homogène, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX(veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: normotendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- UTERUS: antéversé, structure homogène avec ligne de vacuité régulière.</p><p>- ANNEXES : Présence d’une formation kystique anéchogène à paroi fine avec contours bien limité, </p><p>  mesurant 59mm x 74mm, situé à droite de l’utérus et à gauche de l’utérus présence d’une kyste mesurent 26mm×35mm.</p><p>- Cul-de-sac de Douglas libre.</p><p></p><p>*** CONCLUSION: -Kyste de l’ovaire billatérale.</p>'),(66,'Pour la femme','<p>TECHNIQUE: L`examen est réalisé par voie transcutanée</p><p> </p><p>- Foie de taille normale, de contours réguliers, d\'échostructure homogène.</p><p>- Le tronc porte et les veineux sus hépatiques sont perméables et leur calibres normaux.</p><p>- Vésicule biliaire de taille normale, sa paroi  fine, son contenu transonore.</p><p>- Pas de dilatation des voies biliaires intra et extra hépatiques.</p><p>- Pancréas de taille et de morphologie normaux.</p><p>- Rate de taille et morphologie normaux.</p><p>- Rein D de taille normale,  contours réguliers. Il présente une bonne différenciation cortico-méduliare.</p><p>  Absence de calcul ni de stase urinaire.</p><p>- Rein G de taille normale,  contours réguliers. Il présente une bonne différenciation cortico-méduliare.</p><p>  Absence de calcul ni de stase urinaire.</p><p>- Vessie en réplétion, à paroi fine, son contenu transonore</p><p>- Utérus: </p><p>    1- position: antéversé de DAP: mm contours  réguliers</p><p>    2- myomètre: homogène</p><p>    3- endomètre: mm, hyperéchogène hypoéchogène mince ovulation</p><p>    4- cavité: vide</p><p>- Annexes: normaux</p><p>- Cul-de-sac de Douglas: libre</p><p></p><p>*** CONCLUSION: Absence d`anomalie évidente à l`étage abdomino-pelvien exploré.</p><p>                Aspect échographique compatible avec.</p>'),(67,'ÉCHOGRAPHIE THYROÏDIENNE','<p>- La thyroïde présente les dimensions suivantes :</p><p>- Lobe droit : mm de haut, mm d’épaisseur, mm de large.</p><p>- Lobe gauche :  mm de haut, mm d’épaisseur, mm de large.</p><p>- Isthme : mm d’épaisseur.</p><p>- Les contours sont réguliers( déformés dans la région para-isthmique gauche, droite par une formation nodulaire).</p><p>- L’échostructure est homogène  ( hétérogène avec individualisation de multiples formations nodulaires hypoéchogène)</p><p>- Du côté droit, on retient un nodule.</p><p>- Du côté gauche, on retrouve .</p><p>- Absence d\'adénopathie le long des axes jugulo-carotidiens.</p><p>- Pas d\'argument en faveur d\'une pathologie para-thyroidienne.</p><p></p><p>*** CONCLUSION : Echographie thyroidienne normale.</p>'),(68,'CLINIQUE: Doppler des MI','<p>- L\' étude a d\'abord porté sur l\'aorte abdominale dont la paroi est normale.</p><p>- Il n\'existe pas d\'anévrysme.</p><p>- En effet, le diamètre de l\'aorte abdominale sous-rénale n\'excède pas 20 mm.</p><p>- Les axes iliaques apparaissent normalement perméables et leur paroi est d\'aspect normal.</p><p>- Les flux sont conservés.</p><p>- L\'étude morphologique fémoro-poplitée montre à droite comme à gauche un aspect pariétal </p><p>  normal sans infiltration athéromateuse ni plaque saillante. </p><p>- L\'étude vélocimétrique montre des flux bien conservés avec bonne modulation systolo-diastolique.</p><p>- Les axes de jambe étudiés en Doppler continu ont un flux normal avec enregistrement à droite comme.</p><p>  à gauche de l\'artère tibiale postérieure et de l\'artère tibiale antérieure.</p><p></p><p>*** CONCLUSION:Bilan morphologique et vélocimétrique normal au niveau des axes explorés.</p>'),(69,'CLINIQUE: Doppler rénal','<p>- Les artères rénales ont été étudiées à leur origine dans leur portion juxta-ostiale.</p><p>- Elles apparaissent bien perméables avec bonne modulation systolo-diastolique.</p><p>- Il n\'existe pas d\'augmentation des vitesses systoliques et donc absence de signe direct de sténose </p><p>  hémodynamiquement significative.</p><p>- L\'étude ensuite a porté sur leur portion intra-rénale et il existe également un flux bien conservé.</p><p>- Absence d\'amortissement systolique.</p><p>- Ainsi, il n\'existe pas de signe indirect en faveur de sténose hémodynamiquement significative en amont.</p><p></p><p>*** CONCLUSION:Absence d\'argument en faveur d\'une participation réno-vasculaire à l\'hypertension.</p>'),(70,'CLINIQUE: Doppler carotidien','<p>- L\' étude morphologique du système carotidien montre un aspect pariétal normal sans infiltration </p><p>  athéromateuse ni plaque saillante; l\'étude vélocimétrique met en évidence des flux conservés avec </p><p>  bonne modulation systo-diastolique.</p><p>- Il n\'existe pas de signe de sténose ou d\'occlusion carotidienne.</p><p>- Les artères sous-clavières ont un aspect morphologique normal, et apparaissent bien perméable avec</p><p>  bonne modulation systolo-diastolique.</p><p>- Les artères vertébrales étudiées dans leur segment pré et inter-transversaire ont un flux normal</p><p>  sans signe de sténose ou d\'occlusion; absence d\'argument en faveur d\'un hémo-détournement vertébral.</p><p></p><p>*** CONCLUSION:Bilan morphologique et vélocimétrique normal des axes explorés.</p>'),(71,'Bilan de troubles de l\'érection.','<p>- L\'étude a d\'abord porté sur l\'aorte et les axes iliaques qui apparaissent normalement perméables;</p><p>  à droite comme à gauche, on enregistre une artère hypogastrique de flux correct.</p><p>- Avant injection de vaso-dilatateur, on enregistre les artères dorsales de la verge.</p><p>- Après injection de 20 mg intra-caverneux de Papavèrine ou de 10 mg d\'ALPROSTADIL, on visualise </p><p>  une dilatation des artères caverneuses avec bonne ampliation systolo-diastolique.</p><p>- Les vitesses maximales apparaissent supérieures à 30 cm / s ce qui signe un apport artèriel </p><p>  intra-caverneux satisfaisant.</p><p>- Cliniquement, on obtient une bonne érection.</p><p>- Sur les temps tardifs, on observe un abaissement diastolique avec des vitesses diastoliques </p><p>  inférieures à 5 cm / s, ce qui signe à priori l\'absence de fuite veineuse.</p><p>- Absence d\'anomalie morphologique des corps caverneux par ailleurs.</p><p></p><p>*** CONCLUSION:Absence d\'argument en faveur d\'une participation vasculaire aux anomalies cliniques du patient.</p>'),(72,'Echo pelvienne','<p></p><p>TECHNIQUE : L\'examen est réalisé par voie sus-pubienne puis par voie endovaginale.</p><p></p><p>- L\'utérus est antéversé et mesure  :  mm x  mm x  mm, ses contours sont réguliers.</p><p>- Le myomètre est homogène.</p><p>- L\'endomètre mesure : mm au   ème jour du cycle.</p><p>- Le col d`épaisseur normal, contours réguliers, son échostructure est homogène.</p><p>- L\'ovaire droit mesure  mm dans sa plus grande dimension.</p><p>- L\'ovaire gauche mesure  mm dans sa plus grande dimension.</p><p>- Leur échostructure( des ovaires ) est normale.</p><p>- Absence d\'épanchement au niveau du cul de sac-de-Douglas.</p><p>- On a vérifié la finesse des cavités pyélo-cailicielles des deux reins.</p><p></p><p>*** CONCLUSION:Echographie pelvienne normale</p>'),(73,'Abdomino-pelvienne bien détaillée chez la femme','<p>TECHNIQUE: L`examen est réalisé par voie sus-pubienne</p><p> </p><p>- Le foie est de taille normale, de contours réguliers, d’échostructure homogène dans son ensemble. </p><p>- Les systèmes veineux (porte et sus-hépatiques) sont libres et de calibres normaux. </p><p>- La vésicule biliaire est alithiasique, de taille normale, à parois fines.</p><p>  Les voies biliaires intra et extra-hépatiques ne sont pas dilatées.</p><p>- Le pancréas est de taille et d’échostructure normale, de contours réguliers. </p><p>  Absence de dilatation du canal de Wirsung.</p><p>- La rate est homogène, de taille normale.</p><p>- Les reins sont de taille et d’échostructure normale, sans dilatation des cavités pyélo-calicielles. </p><p>- Absence d’anomalie des loges surrénaliennes visibles.</p><p>- Vessie a une expansion normale, une contenu transonore et sa paroi fine.</p><p>- L\'utérus est antéversé et meusure mm x  mm x mm, ses contours réguliers.</p><p>- Le myomètre est homogène.</p><p>- L\'endomètre meusure mm au ème jour du cycle.</p><p>- Le col: épaisseur mm, contours réguliers, son échostructure est homogène.</p><p>- L\'ovaire droit meusure  mm dans sa plus grande dimension.</p><p>- L\'ovaire gauche meusure  mm dans sa plus grande dimension.</p><p>- Leur échostructure( des ovaires ) normale.</p><p>- Absence d\'adénopathie para-aortique visible.</p><p>- Les gros vaisseaux du rétro-péritoine ont un calibre normal.</p><p>- Cul de sac-de-Douglas : libre</p><p></p><p>*** CONCLUSION:Echographie abdomino-pelvienne normale.</p>'),(74,'Echo abdomino-pelvienne bien détaillée chez l`homme','<p>TECHNIQUE: L`examen est réalisé par voie sus-pubienne</p><p></p><p>- Le foie est de taille normal, de contours réguliers. Son échostructure est homogène.</p><p>  Les vaisseaux sus-hépatiques et porte ont un trajet et un calibre normaux.</p><p>  Il n’existe pas de dilatation des voies biliaires intra-hépatiques.</p><p>- La voie biliaire principale est fine.</p><p>- La vésicule biliaire se remplie normalement à jeûn. Son contenu est transonore. Sa paroi est fine.</p><p>- Le pancreas a des contours réguliers, une échostructure normale. </p><p>  On ne met pas en évidence de dilatation du canal de Wirsung.</p><p>- La rate est homogène et de taille normale.</p><p>- Les reins ont des contours réguliers, une taille normale ( cm à droite, cm à gauche) . </p><p>  Les cavités sont fines et ne contiennent aucun calcul. La différenciation cortico-médullaire est bien visible. </p><p>- Il n\'est constaté aucune anomalie des loges surrénaliennes.</p><p>- La vessie a une expansion normale, un contenu transonore et sa paroi meusure....mm.</p><p>- La prostate: ne réalise aucune saillie sur le plancher vésicale. Elle meusure:..mm x ...mm x ... mm.</p><p>  Sa masse est estimée à ....g. L\'èchostructure prostatique est homogène et la capsule bien définie.</p><p>- Les vésicules séminales, ont une échostructure normale.</p><p>- Il n\'existe pas de résidus post-mictionnel.</p><p>- Cul de sac-de-Douglas: libre.</p><p>- Les gros vaisseaux du rétro-péritoine ont un calibre normal.</p><p>- Absence d\'adénopathie visible.</p><p></p><p>*** CONCLUSION:Echographie abdomino-pelvienne normale.</p>'),(75,'ABDOMINO-PELVIC ULTRASONOGRAPHY (M)','<p>- Liver: normal size, fine et homogenous structure, smooth surface.</p><p>- Gall Bladder : the gall bladder wall is thin and regular, anechogenous contents.</p><p>- Billiary ducts are not dilated.</p><p>- Pancreas: Head and body of pancreas are normal.</p><p>- Kidneys: volume, forme and structure are normal. Absence of stone nor urinary stasis.</p><p>- Spleen is normal.</p><p>- Bladder: the bladder wall is thin and regular, clear contents.</p><p>- Prostate is normal.</p><p>- Douglas pouch is free.</p><p></p><p>*** CONCLUSION: No obvious abnormality founded in the abdomino-pelvic ultrasonography.</p>'),(76,'ABDOMINO-PELVIC ULTRASONOGRAPHY (F)','<p>- Liver: normal size, fine and homogenous structure, smooth surface.</p><p>- Gall Bladder : the gall bladder wall is thin and regular, anechogenous contents.</p><p>- Biliary ducts are not dilated.</p><p>- Pancreas: Head and body of pancreas are normal.</p><p>- Kidneys: volume, forme, structure are normal. Absence of stone nor urinary stasis.</p><p>- Spleen is normal.</p><p>- Bladder: the bladder wall is thin and regular, clear contents.</p><p>- Uterus is anteversion, APD: ... mm, homogenous structure, endometrium mesured ...mm </p><p>  related to the  ... th day of mestrual cycle.</p><p>- Uterine appendages are normal.</p><p>- Douglas pouch is free.</p><p></p><p>*** CONCLUSION: No obvious abnormality founded in the abdomino-pelvic ultrasonography.</p>'),(77,'ABDOMINO-PELVIC SONOGRAPHY (M)','<p>- Liver: normal size, fine and homogenous structure, smooth surface.</p><p>- Gall Bladder : the gall bladder wall is thin and regular, anechogenous contents.</p><p>- Biliary ducts are not dilated.</p><p>- Pancreas: Head and body of pancreas are normal.</p><p>- Kidneys: volume, forme, structure are normal. Absence of stone nor urinary stasis.</p><p>- Spleen is normal.</p><p>- Bladder: the bladder wall is thin and regular, clear contents.</p><p>- Prostate is normal.</p><p>- Douglas pouch is free.</p><p></p><p>*** CONCLUSION: No obvious abnormality founded in the abdomino-pelvic ultrasonography.</p>'),(78,'ABDOMINO-PELVIC SONOGRAPHY (F)','	<p>- Liver: normal size, fine and homogenous structure, smooth surface.</p><p>- Gall Bladder : thin and regular gall bladder wall, anechogenous contents.</p><p>- Biliary ducts : no dilation.</p><p>- Pancreas: normal.</p><p>- Kidneys: normal volume, forme and structure. No stone, no urinary stasis.</p><p>- Spleen : normal.</p><p>- Bladder: thin and regular bladder wall, clear contents.</p><p>- Uterus : anteversion, APD: ... mm, homogenous structure, endometrium mesured ...mm related to the ... th day of menstrual cycle.</p><p>- Uterine appendages : normal.</p><p>- Douglas pouch : free.</p><p>&nbsp;</p><p>*** CONCLUSION: No obvious abnormality founded in the abdomino-pelvic sonography.</p>\r\n'),(79,'THYROID ULTRASONOGRAPHY','<p class=\"pf0\"><span class=\"cf0\">-CLINICAL FINDINGS.</span></p><p class=\"pf0\"><span class=\"cf1\"> </span></p><p class=\"pf0\"><span class=\"cf0\">-Right Lobe : Normal/ Abnormal diameter ....mm</span></p><p class=\"pf0\"><span class=\"cf1\"> </span></p><p class=\"pf0\"><span class=\"cf0\">-Echo texture :  Homogenous / Heterogeneous</span></p><p class=\"pf0\"><span class=\"cf0\">-Size  :  Normal / Enlarged</span></p><p class=\"pf0\"><span class=\"cf0\">-Focal Abnormality       : Yes / No</span></p><p class=\"pf0\"><span class=\"cf0\">-If yes, number / site   : Diameter....mm</span></p><p class=\"pf0\"><span class=\"cf1\"> </span></p><p class=\"pf0\"><span class=\"cf0\">-Left Lobe : Normal / Abnormal diameter.....mm</span></p><p class=\"pf0\"><span class=\"cf0\">                           </span></p><p class=\"pf0\"><span class=\"cf0\">-Echo texture :  Homogenous / Heterogeneous</span></p><p class=\"pf0\"><span class=\"cf0\">-Size  :  Normal / Enlarged</span></p><p class=\"pf0\"><span class=\"cf0\">-Focal Abnormality  : Yes / No</span></p><p class=\"pf0\"><span class=\"cf0\">-If yes, number / site   : Diameter....mm</span></p><p class=\"pf0\"><span class=