e, surface lisse avec contours réguliers. </p><p>        Absence de nodule décelable dans le parenchyme hépatique.</p><p>- SYSTEME VEINEUX (veine porte et VSH): est de calibre normal et perméable.</p><p>- VÉSICULE BILIAIRE: hypertendue, paroi mince et régulière de contenu anéchogène.</p><p>- VOIES BILIAIRES: non dilatées.</p><p>- PANCRÉAS: forme et structure normales.</p><p>- REIN D: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- REIN G: taille, structure et forme normaux. Absence de calcul ni de stase urinaire.      </p><p>- RATE: taille et structure normales.</p><p>- VÉSSIE: bien remplie, paroi mince et régulière de contenu clair.</p><p>- PROSTATE: volume, forme et structure normaux.</p><p>- Cul-de-sac de Douglas libre.</p><p>*** CONCLUSION: Cholécystite.</p>'),(83,'ផ្ទៃពោះក្រោម៣ខែ (ត្រីមាសទី១)','		<p><span style=\"font-family:KhmerOSMuol;\">ពិនិត្យផ្ទៃពោះត្រីមាសទី១</span></p><ul><li>ផ្ទៃពោះលើកទី ០១</li><li>ស្ថានភាពស្បូន : មានទំហំធម្មតា</li><li>ជញ្ជាំងស្បូន : ស្មើសាច់</li><li>ស្រទាប់ខាងក្នុងស្បូនមានថង់កូនទំហំ ៣០ មម</li><li>មានទារកចំនួន ០១</li><li>ទារកមានប្រវែងបណ្តោយខ្លួន (CRL) : ៣០ មម</li><li>ចង្វាក់បេះដូង ១៤០​ ដងក្នុងមួយនាទី</li><li>កន្សោមពងខាងស្តាំ : មានរូបរាង និង ទំហំ ធម្មតា</li><li>កន្សោមពងខាងឆ្វេង : មានរូបរាង និង ទំហំ ធម្មតា</li><li>ជុំវិញស្បូន : មិនមានទឹកដក់ ឬ រូបភាពអ្វីគួរអោយកត់សំគាល់ឡើយ ។</li></ul><p>ការសន្និដ្ឋាន&nbsp;</p><ul><li>ទារកក្នុងផ្ទៃមានអាយុ ០០ សប្តាហ៍ ០០ ថ្ងៃ</li><li>ទារកគ្រប់ខែសំរាលប្រហែលថ្ងៃទី ០០ ខែ មករា ឆ្នាំ ២០២៤ ។</li><li>ណាត់ជួបពិនិត្យម្តងទៀតនៅថ្ងៃទី ០០ ខែ មករា ឆ្នាំ ២០២៤ ខែបន្ទាប់ ។</li></ul><p>&nbsp;</p><p>&nbsp;</p>\r\n	'),(87,'Early Pregnancy','<p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>fa