00</span>ដង/ វះកាត់ <span style=\"color:#0000ff;\">០០</span>ដង/រលូត <span style=\"color:#0000ff;\">០០</span>ដង</td></tr><tr><td>ចំនួនទារកក្នុងផ្ទៃ&nbsp;</td><td><span style=\"color:rgb(0,0,255);\">﻿០១</span></td></tr><tr><td>សុខភាពទារក</td><td>﻿ល្អ&nbsp;</td></tr><tr><td>ទីតាំងសុក</td><td>﻿នៅខាងមុខ ខាងក្រោយ មុខឈៀងឆ្វេង&nbsp;</td></tr><tr><td>បរិមាណទឹកភ្លោះ</td><td>ធម្មតា</td></tr><tr><td>ចង្វាក់បេះដូង</td><td><span style=\"color:#0000ff;\"><strong>000</strong> </span>ដង/នាទី (ធម្មតា ១២០ ទៅ ១៦០ ដង/នាទី)</td></tr><tr><td>ការលូតលាស់របស់ទារក និង ចរលនា</td><td>ល្អធម្មតាលូតលាស់ទៅតាមអាយុទារក / មានចលនាធម្មតា</td></tr><tr><td>ទម្រង់ក្បាលរបស់ទារក</td><td>ក្បាលបង្វិលចុះក្រោម មុខបែខាងស្តាំ&nbsp;</td></tr><tr><td>វិមាត្រទារក<br>&nbsp;</td><td><figure class=\"table\"><table><tbody><tr><td>ទម្ងន់ទារក</td><td>ទំហំក្បាល</td><td>ប្រវែងឆ្អឹងភ្លៅ</td><td>វង្វាស់ពោះ</td></tr><tr><td><span style=\"color:#0000ff;\"><strong>000</strong></span>&nbsp;ក្រាម</td><td><span style=\"color:#0000ff;\">00</span>&nbsp;មីលីម៉ែត្រ<br>&nbsp;</td><td><span style=\"color:#0000ff;\">00</span>&nbsp;មីលីម៉ែត្រ<br>&nbsp;</td><td><span style=\"color:#0000ff;\">00</span>&nbsp;មីលីម៉ែត្រ<br>&nbsp;</td></tr></tbody></table></figure></td></tr><tr><td>ទារកមានអាយុ</td><td><span style=\"color:#0000ff;\"><strong>00</strong></span> សប្តាហ័ <span style=\"color:#0000ff;\"><strong>00</strong></span> ថ្ងៃ</td></tr><tr><td>ទារកគ្រប់ខែសម្រាលតាមអេកូ</td><td>ថ្ងៃទី <span style=\"color:#0000ff;\"><strong>00</strong></span> ខែ<span style=\"color:#0000ff;\"><strong> 00</strong></span> ឆ្នាំ <span style=\"color:#0000ff;\"><strong>2025 </strong></span>(កើតមុនឬក្រោយ ០៧ថ្ងៃ)</td></tr><tr><td>ការសន្និដ្ឋាន</td><td><p>សុភាពទាករល្អ,ពុំមានទងសុករុំកទេ</p><p>ណាត់ជួពិនិត្យនៅ&nbsp;<span style=\"background-color:transparent;color:inherit;\">ថ្ងៃទី&nbsp;</span><span style=\"color:#0000ff;\">00</span><span style=\"background-color:transparent;color:inherit;\">&nbsp;ខែ</span><span style=\"color:#0000ff;\">&nbsp;00</span><span style=\"background-